import '../estilos/SkillsBanner.css';
import CardSkill from './CardSkill';

import { FaHtml5 } from "react-icons/fa";
import { FaCss3Alt } from "react-icons/fa";
import { IoLogoJavascript } from "react-icons/io5";

export default function SkillsBanner(){
    return(
        <div className="bannerSkills">
            <div className="center"></div>
                <CardSkill 
                    habilidade ="HTML5" 
                    icone={<FaHtml5 />} 
                    descricao="Experiência com marcações HTML organizadas usando o poder do HTML5."
                />
                <CardSkill 
                    habilidade ="CSS3" 
                    icone={<FaCss3Alt />} 
                    descricao="Habilidades em estilizações de conteúdo com as ferramentas do CSS3."
                />
                <CardSkill 
                    habilidade ="JavaScript" 
                    icone={<IoLogoJavascript />} 
                    descricao="Criação de páginas interativas com o poder da linguagem JavaScript além de suas bibliotecas como jQuery."
                />
        </div>
    );
}
